const Home = () => {
  return (
    <div>
      <h1>Header(Logo, navigation menu, Login/signup button)</h1>
      <h1>
        Hero Section(Headline - main message of the site, subheading,
        Call-to-action [Signup, Learn More, Get started])
      </h1>
      <h1>
        Features/Services Section (List of key features or services provided,
        Icons or images representing each feature, Short descriptions)
      </h1>
      <h1>Home Page</h1>
    </div>
  );
};

export default Home;
